import React from 'react';

export default function PopupWithForm(props) {
    return(
        <>
            <div className="popup popup_content_edit">
                <div className="popup__container">
                    <button className="popup__close" aria-label="Закрыть" type="button"></button>
                    <h2 className="popup__title popup__title_edit">Редактировать профиль</h2>
                    <form className="popup__form popup__form_edit" name="edit-profile" noValidate>
                        <button className="popup__button popup__button_edit" type="submit">Сохранить</button>
                    </form>
                </div>
            </div>
        </>

    )
}
